import React, { useState } from "react";
import CartRow from './cart';
import {Title, Container, TitleImage} from "./Car_Long_Term";

export default function Furgoni_Long_Term() {
    const [dates, setData] = useState([]);
    async function componentDidMount() {
        try {
            const res = await fetch('/api/car/lungo/furgoni');
            const data = await res.json();
            setData(data);
        } catch (e) {
            console.log(e);
        }
    }
    componentDidMount();
    return(
        <>
        <Container>
            <TitleImage src="/static/images/top_image2.png"/>
            <Title>Noleggio a lungo termine</Title>
        </Container>
        <CartRow date={dates}/>
        </>
    );
}
